import React, {useState} from "react";

const ToDo_list = [
  {id: 1, name: "Magnus"},
  {id: 2, name: "Oda"},
];

const App = () => {
  return(
    <ul>
      {ToDo_list.map((item) => (
        <li> key={item.id}>{item.name}</li>
      ))}
    </ul>
  );
}
